const ValueBoxes = (props) => {
     var isMutable = props.readOnly
     var values = props.values ? props.values : Array(4).fill("")
    return (
        <div>
            <input type="text" readOnly={true} value={values[0]}/>
            <input type="text" readOnly={false} value={values[1]}/>
            <input type="text" readOnly={props.readOnly} value={values[2]}/>
            <input type="text" readOnly={props.readOnly} value={values[3]}/>
        </div>
    )
}

export default ValueBoxes;
